import React from "react";
import TableComponent from "./TableComponent/TableComponent";
import Breadcrumb from "./TableComponent/Breadcrumb";
import DetailedData from "./TableComponent/DetailedData";

function App() {
  return (
    <div>
      <h1>Dynamiczna tabela z breadcrumb</h1>
      <Breadcrumb />
      <TableComponent />
      <DetailedData />
    </div>
  );
}

export default App;
